import React from "react";
import "./header.css";

function Ironhack() {
  return (
    <div className="header">
      <img alt="ironhack" className="ironhack" src="./img/ironhack-logo.svg" />
      <img alt="ironhack" className="menu" src="./img/menu-top.svg" />
    </div>
  );
}

export default Ironhack;
